package lcfor2020.dwContest;

public class c2 {
    public int numWays(String s) {
        int numOf1=0;
        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i)=='1'){
                numOf1++;
            }
        }
        if (numOf1%3!=0){
            return 0;
        }
        int numOf1ForEach=numOf1/3;
        if (numOf1ForEach==0){
            //C£¨s.length-1,2£©
            return getC(s.length()-1,2);
        }else {
            int countFor1=0;
            long lenFor01=-1,lenFor02=-1;
            for (int i = 0; i < s.length(); i++) {
                if (s.charAt(i)=='1'){
                    if (lenFor01!=-1 && lenFor02!=-1){
                        break;
                    }
                    countFor1++;
                    if (countFor1==numOf1ForEach){
                        countFor1=0;
                        if (lenFor01==-1){
                            lenFor01=0;
                        }else if (lenFor01!=-1 && lenFor02==-1){
                            lenFor02=0;
                        }
                    }
                }else if (countFor1==0){
                    if (lenFor01!=-1 && lenFor02==-1){
                        lenFor01++;
                    }else if (lenFor02!=-1){
                        lenFor02++;
                    }
                }
            }
            System.out.println("1");
            return (int)((lenFor01+1)*(lenFor02+1)%((long)(Math.pow(10,9)+7)));
        }
    }
    public int getC(int a,int b){
        long aa=1,bb=1,cc=1;
        long count=1;
        for (long i = a; i >0; i--) {
            count*=i;
        }
        for (int i = 1; i <=b; i++) {
            bb*=i;
        }
        for (int i = 1; i <= a-b; i++) {
            cc*=i;
        }
        return (int)(count/bb/cc);
    }

    public static void main(String[] args) {
        c2 myc2=new c2();
        System.out.println(myc2.getC(3,2));
//        System.out.println(myc2.numWays(""));
    }
}
